import{_ as e,c as o,o as i,ah as n}from"./chunks/framework.PvdZnrZd.js";const u=JSON.parse('{"title":"ARTIST PRODUCT DESIGN","description":"ARTIST PRODUCT DESIGN","frontmatter":{"title":"ARTIST PRODUCT DESIGN","description":"ARTIST PRODUCT DESIGN","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/Marketplace Product Add-Ons/ARTIST PRODUCT DESIGN.md","filePath":"zenith/featured-app/Marketplace Product Add-Ons/ARTIST PRODUCT DESIGN.md"}'),a={name:"zenith/featured-app/Marketplace Product Add-Ons/ARTIST PRODUCT DESIGN.md"};function r(l,t,s,d,p,c){return i(),o("div",null,[...t[0]||(t[0]=[n('<h3 id="introduction" tabindex="-1">INTRODUCTION <a class="header-anchor" href="#introduction" aria-label="Permalink to &quot;INTRODUCTION&quot;">​</a></h3><p>Till now, the Admin was able to create/allow Sellers on his <a href="https://marketplace-doc.webkul.com/classic/Introduction/" target="_blank" rel="noreferrer">Multivendor Marketplace for Shopify</a>, but now with the new Multivendor Marketplace feature app, <strong>Artist Product Design</strong>.</p><p>Admin can create/add Artists on his store and let them add designs for the products to sell.</p><p>If the Admin wants to sell products with designs from different Artists then he can do so by using this featured app.</p><p>This app comes at a cost of <strong>$10.00</strong> per month.</p><h3 id="note-these-points" tabindex="-1">NOTE THESE POINTS <a class="header-anchor" href="#note-these-points" aria-label="Permalink to &quot;NOTE THESE POINTS&quot;">​</a></h3><ul><li>Admin can decide whether he wants to create his Multivendor Marketplace only for <em>Artists</em> or for <em>Sellers</em> as well.</li><li>Admin can&#39;t convert the already added Seller into Artists.</li><li>Two different artists/sellers can&#39;t have similar email IDs.</li><li>Admin can decide whether he wants his Artists to create products or not.</li><li>Designs by Artists can only be added to normal products.</li></ul><h3 id="workflow" tabindex="-1">WORKFLOW <a class="header-anchor" href="#workflow" aria-label="Permalink to &quot;WORKFLOW&quot;">​</a></h3><h2 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h2><p>Visit the featured apps section of the Multivendor Marketplace for Shopify &amp; enable the <em>Artist Product Design</em> feature app:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdo.webp" alt="Feature Apps Admin"></p><p>After accepting the charges, you are good to go!</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdt.webp" alt="Feature Apps Admin (1)"></p><h2 id="configuring-admin-panel" tabindex="-1">Configuring Admin Panel <a class="header-anchor" href="#configuring-admin-panel" aria-label="Permalink to &quot;Configuring Admin Panel&quot;">​</a></h2><p>Go to: Multivendor Marketplace Admin Panel &gt; Configuration &gt; Seller Configuration:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdthr.webp" alt="Dashboard Admin"></p><p>On the Seller Configuration page, the Admin will have a configuration regarding this app:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdfr.webp" alt="WHETHER YOU WANT TO HAVE SELLER ALSO ON THE STORE"></p><h2 id="artist-product-design-configuration" tabindex="-1">Artist Product Design Configuration <a class="header-anchor" href="#artist-product-design-configuration" aria-label="Permalink to &quot;Artist Product Design Configuration&quot;">​</a></h2><p>Further, go to Multi vendor Marketplace Admin Panel &gt; Configuration &gt; Artist Design Configuration:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdfv.webp" alt="ARTIST PRODUCT DESIGN CONFIGURATION"></p><p>(i)</p><ul><li><strong>Enter a label for the Artist:</strong> From this option, you can change the label for the Artist on the artist panel.</li><li><strong>Allow the artist to add a product:</strong> From this option, you will be able to allow the artist so, they can also add products to your marketplace store.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdsx.webp" alt="DESIGN VERIFICATION"></p><p>(ii)</p><ul><li><strong>Design Verification:</strong> From this option, you can physically verify the artist&#39;s product designs.</li><li><strong>Print Packing Slip:</strong> From this option, you can allow the artist to print packing slips of the designs.</li><li><strong>Store Location Name:</strong> Enter the location name of your store.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdsv.webp" alt="ARTIST PRODUCT DESIGN: CONFIGURATION"></p><p>(iii)</p><ul><li><strong>Store Location:</strong> Enter the complete address of your store where you want to receive the packet</li><li><strong>The</strong> <strong>Store Location City:</strong> Enter the city of your store&#39;s location.</li><li><strong>Country:</strong> Enter the country of your store&#39;s location.</li><li><strong>State</strong></li><li><strong>Store Location Zipcode</strong></li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdei.webp" alt="ARTIST PRODUCT DESIGN: CONFIGURATION"></p><p>(iv)</p><ul><li><strong>Enable Initial Replacement Value:</strong> From this option, the admin can set an initial replacement value on the product designs.</li></ul><p>Enabling this option, You will be asked to update the initial replacement value whose value is not set previously for the design.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdreview.webp" alt="Initial Replacement Value "></p><ul><li><strong>Initial Replacement Value Type:</strong> The initial replacement value will be in percentage.</li><li><strong>Initial Replacement Value:</strong> Enter the initial replacement value whose percentage amount will be applied to product designs.</li></ul><h2 id="note" tabindex="-1">Note: <a class="header-anchor" href="#note" aria-label="Permalink to &quot;Note:&quot;">​</a></h2><p><strong>Initial Replacement Value</strong> is the amount payable by the admin to the artist</p><p>If the artist&#39;s product (which was sent to the admin for physical verification) gets lost, damaged, etc. during the process of verification.</p><ul><li><strong>Artist Commission:</strong> You can set a separate commission on artist product designs.</li></ul><p>If you disable it, the commissions will be charged on the basis of the commission set on your marketplace. It can be any global, collection, product, membership or seller commission.</p><ul><li><strong>Edit Template:</strong> You can edit the artist design package slip template that is used for physical verification.</li></ul><h2 id="custom-fields-for-artist" tabindex="-1">Custom Fields for Artist <a class="header-anchor" href="#custom-fields-for-artist" aria-label="Permalink to &quot;Custom Fields for Artist&quot;">​</a></h2><p>The admin can add custom fields for the designs added by the seller.</p><p>Perform this function by visiting Multi-vendor Marketplace Admin Panel &gt; Configuration &gt; Custom Fields. While adding the fields, select the field type as <strong>design</strong>.</p><p>Further, to know more regarding custom fields, check out the following blog:<br><a href="https://webkul.com/blog/add-custom-fields-on-multi-vendor-marketplace-for-shopify/" target="_blank" rel="noreferrer">Add Custom Fields on Multi-Vendor Marketplace for Shopify</a>.</p><h2 id="whether-you-want-to-have-seller-also-on-the-store" tabindex="-1"><strong>WHETHER YOU WANT TO HAVE SELLER ALSO ON THE STORE</strong> <a class="header-anchor" href="#whether-you-want-to-have-seller-also-on-the-store" aria-label="Permalink to &quot;**WHETHER YOU WANT TO HAVE SELLER ALSO ON THE STORE**&quot;">​</a></h2><p>If you disable this option then on the <em>Seller Registration page</em>,</p><p>The sellers will have the option to join only as Artists but if you enable this option then Sellers can register themselves as Sellers also.</p><p>Similarly, if disabled, the Admin will be able to add only Artists on his store.</p><p><em>If you don&#39;t want Sellers on your Multivendor Marketplace &amp; want to have a store only for Artists then disable this option.</em></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/signupmvm.webp" alt="Signup • Multivendor MarketPlace"></p><h2 id="allow-artist-to-add-product" tabindex="-1"><strong>ALLOW ARTIST TO ADD PRODUCT</strong> <a class="header-anchor" href="#allow-artist-to-add-product" aria-label="Permalink to &quot;**ALLOW ARTIST TO ADD PRODUCT**&quot;">​</a></h2><p>Your Artists will be able to add products from the Multivendor Marketplace Artist panel.</p><p>Mark that: If you want your Artist to add products then enable this option and with that make sure you have enabled the ALLOW SELLER TO ADD/EDIT/DELETE PRODUCT options from the Product Configuration.</p><p>Go to: Multivendor Marketplace Admin Panel &gt; Configuration &gt; Product Configuration:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdnin.webp" alt="Configuration Admin (1)"></p><h3 id="admin-adding-artists" tabindex="-1">Admin Adding Artists <a class="header-anchor" href="#admin-adding-artists" aria-label="Permalink to &quot;Admin Adding Artists&quot;">​</a></h3><p>Go to: Multivendor Marketplace Admin Panel &gt; Sellers &gt; Seller Listing &gt; Add Seller:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdten.webp" alt="Seller Admin"></p><p>Fill the Add Seller form as usual &amp; select Join As-</p><p><em>Artist</em> (if Admin has disabled the WHETHER YOU WANT TO HAVE SELLER ALSO ON THE STORE option from the configuration then here he will not get the &#39;Join As&#39; option for Seller)</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdele.webp" alt="Add Seller Admin"></p><p>Added Artists will be visible on the Seller Listing page-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdtwel.webp" alt="Seller Admin (1)"></p><p>Further, the Admin can edit/disable the Artist but can&#39;t delete it.</p><h2 id="artists-registering-themselves" tabindex="-1">Artists Registering themselves <a class="header-anchor" href="#artists-registering-themselves" aria-label="Permalink to &quot;Artists Registering themselves&quot;">​</a></h2><p>On the registration form, Seller needs to join as Artist:</p><p>(You can find the link for Seller Registration Page on the frontend)</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/signupmvm.webp" alt="Signup • Multivendor MarketPlace (1)"></p><p>After this, the Artist will be redirected to the Multivendor Marketplace Artist Panel (if the Admin has enabled the AUTO APPROVE SELLER option from the Seller Configuration,</p><p>Otherwise, the Artist&#39;s request will be sent to the Admin in an approval pending state; the Artist will receive an email with the Artist/Seller panel link, after the approval).</p><p>The Artist Panel will be similar to the Seller Panel except, the Artist will have an option to add Product Design.</p><h2 id="artist-adding-product-design" tabindex="-1">Artist Adding Product Design: <a class="header-anchor" href="#artist-adding-product-design" aria-label="Permalink to &quot;Artist Adding Product Design:&quot;">​</a></h2><p>Go to: Multivendor Marketplace Artist Panel &gt; Products &gt; Product Design &gt; Add Products Design:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdtrteen.webp" alt="SELLER PANEL: PRODUCT DESIGN"></p><p>The artist needs to enter the required details &amp; save the product design:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/12/apdfteen.webp" alt="ADD PRODUCT DESIGN"></p><p>The Admin will receive this created product design in an approval pending state. So to add product designs to the products, the Admin needs to enable the product design from Admin Panel.</p><p>Go to: Multivendor Marketplace Admin Panel &gt; Products &gt; Product Design &gt; Enable the design:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Product-Design-Admin-2.png" alt="ALL ARTIST DESIGNS"></p><p>When enabled by the Admin, the Artist will have the product design on the Products &gt; Product Design page in an approved state:</p><p>Artists can further edit the name &amp; description of the product design but can&#39;t update the product design image or the price</p><p>And once the created product design is used or added to a product, it can&#39;t be deleted.</p><p>Multivendor Marketplace Artist Panel &gt; Products &gt; Product Design</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Products-Design-Seller-%E2%80%A2-Multivendor-MarketPlace-1-1.png" alt="EDIT PRODUCT DESIGN"></p><h2 id="send-design-for-physical-verification" tabindex="-1">Send design for physical verification <a class="header-anchor" href="#send-design-for-physical-verification" aria-label="Permalink to &quot;Send design for physical verification&quot;">​</a></h2><p>Now, the artist needs to send the design for physical verification. To do so, he needs to &#39;edit&#39; the design:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/Edit-Product-Design-Seller-%E2%80%A2-Multivendor-MarketPlace.png" alt="ARTIST PRODUCT DESIGN: SEND DESIGN"></p><p>The artist can also view the packaging slip by clicking on the &#39;<strong>packing slip</strong>&#39;.</p><p>Furthermore, to send the design, click on &#39;<strong>Send Design</strong>&#39;, enter the following details &amp; save.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/Edit-Product-Design-Seller-%E2%80%A2-Multivendor-MarketPlace-1.png" alt="PACKAGE DETAILS"></p><p>Now, the admin needs to verify the design by visiting Multivendor Marketplace Admin Panel &gt; Products &gt; Product Design:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/Product-Design-Admin-1.png" alt="ARTIST PRODUCT DESIGN"></p><p><em>Once verified, this procedure is irreversible.</em></p><p>Admin can further view the design by visiting Multivendor Marketplace Admin Panel &gt; Products &gt; Product Design:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Product-Design-Admin-2-1.png" alt="ARTIST PRODUCT DESIGN"></p><p>Admin can now download the product design image, can change initial replacement value and also set a final initial value.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Download-Design-Admin-1.png" alt="ARTIST PRODUCT DESIGN"></p><h4 id="request-for-change-initial-replacement-value" tabindex="-1">Request For Change Initial Replacement Value <a class="header-anchor" href="#request-for-change-initial-replacement-value" aria-label="Permalink to &quot;Request For Change Initial Replacement Value&quot;">​</a></h4><p>Once the admin sends a request to change the initial replacement value, an email will be sent to the artist.</p><p><strong>Note:</strong> Any further conversation regarding the replacement amount should be conducted over your personal email system.</p><p>That is, there is no such function given in the marketplace for further conversation.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/Download-Design-Admin.png" alt="ARTIST PRODUCT DESIGN"></p><p>Once a mutual replacement value is decided by the consent of both admin &amp; artist, the admin can go ahead and set the final replacement value.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/Download-Design-Admin-1.png" alt="FINAL REPLACEMENT VALUE"></p><p>Note that, the admin needs to attach proof that shows the approval of the seller regarding the final replacement value.</p><p>It can be a file (JPEG, JPG or PDF format). Remember, the maximum size allowed is 3MB.</p><p>The artist can view the replacement value by visiting marketplace seller panel &gt; Products &gt; Product Design &gt; Edit:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/Edit-Product-Design-Seller-%E2%80%A2-Multivendor-MarketPlace-2.png" alt="CONFIGURATION"></p><h2 id="admin-adding-products-with-product-design" tabindex="-1">Admin adding Products with Product Design: <a class="header-anchor" href="#admin-adding-products-with-product-design" aria-label="Permalink to &quot;Admin adding Products with Product Design:&quot;">​</a></h2><p>Multivendor Marketplace Admin Panel &gt; Products &gt; Product Listing &gt; Add Products:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Product-Admin.png" alt="Product Admin"></p><p>To add design to a Product, the Admin needs to choose the product type as &#39;Normal&#39; only</p><p>And the Seller email should be of the Artist whose product design needs to be added (only after entering the Artist&#39;s email ID, the Admin will get an option to choose the product design):</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Add-Product-Admin.png" alt="Add Product Admin"></p><p>Now, to add the product design, click on the &#39;Select Design&#39; button, a pop-up will arrive,</p><p>Where the Admin needs to enter the first three letters of the product design name to get the design in suggestion, select the design,</p><p>Fill all the required fields in the &#39;add product form&#39; &amp; save the product:</p><p><em>Mark that the product price is greater than or equal to the product design price.</em></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Add-Product-Admin-1.png" alt="Add Product Admin (1)"></p><p>The added product can be viewed by the Admin from the Products &gt; Product Listing page. Further, the Admin can edit, disable, delete &amp; reassign the product created:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Product-Admin-1.png" alt="Product Admin (1)"></p><h3 id="admin-reassigning-products" tabindex="-1">Admin Reassigning Products <a class="header-anchor" href="#admin-reassigning-products" aria-label="Permalink to &quot;Admin Reassigning Products&quot;">​</a></h3><p>Admin can reassign the products &amp; after reassigning, the added product design is automatically removed from the product; this has two scenarios:</p><ul><li>If the Product with product design is reassigned to a Seller, then the product design will be removed (by default) &amp; can&#39;t be added to this product as now the product belongs to the Seller &amp; not to the Artist.</li><li>If the product with product design is reassigned to a different Artist, then, the product design will be removed from the product (by default) &amp; needs to be added again (the new product design that will be added should be of the new assigned artist).</li></ul><p>Go to: Multivendor Marketplace Admin Panel &gt; Products &gt; Product Listing &gt; Reassign (as shown in the image above) &gt; Enter the email ID of other Seller/Artist in the pop-up &gt; Reassign:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Product-Admin-2.png" alt="Product Admin (2)"></p><h3 id="artist-adding-products-with-product-design" tabindex="-1">Artist adding Products with Product Design: <a class="header-anchor" href="#artist-adding-products-with-product-design" aria-label="Permalink to &quot;Artist adding Products with Product Design:&quot;">​</a></h3><ul><li>If the Admin has enabled the ALLOW ARTIST TO ADD PRODUCT option from the Seller Configuration, the Artist will be able to add products.</li></ul><p>Go to: Multivendor Marketplace Artist Panel &gt; Products &gt; Product Listing &gt; Add Product:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Product-Seller-%E2%80%A2-Multivendor-MarketPlace.png" alt="Product Seller • Multivendor MarketPlace"></p><p>Similarly, the Artist needs to fill the &#39;add product form&#39;, where he needs to select the product type as normal and he will get the &#39;choose artist design&#39; option by default in the form:</p><p><em>Mark that the product price is greater than or equal to the product design price:</em></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Add-Product-Seller-%E2%80%A2-Multivendor-MarketPlace.png" alt="Add Product Seller • Multivendor MarketPlace"></p><p>The created product will be listed in the Products &gt; Product Listing page.</p><p>From the same page, the Artist can edit/duplicate/delete the created product:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/04/Product-Seller-%E2%80%A2-Multivendor-MarketPlace-1.png" alt="Product Seller • Multivendor MarketPlace (1)"></p><ul><li>If the Admin has disabled the ALLOW ARTIST TO ADD PRODUCT option from the Seller Configuration, the Artist will not be able to add products, he can only view the products from the product listing page.</li></ul><h3 id="commission-scenario" tabindex="-1">Commission Scenario <a class="header-anchor" href="#commission-scenario" aria-label="Permalink to &quot;Commission Scenario&quot;">​</a></h3><p>There are two commission scenarios:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2020/01/Artist-Product-Design-Configuration-Admin-4-1200x692-1.png" alt="Artist-Product-Design-Configuration-Admin-4-1200x692-1"></p><p>Path: Multivendor Marketplace Admin Panel &gt; Configuration &gt; Artist Design Configuration</p><h2 id="scenario-1-the-artist-commission-option-is-enabled" tabindex="-1">Scenario 1: The &#39;<strong>Artist Commission</strong>&#39; option is enabled <a class="header-anchor" href="#scenario-1-the-artist-commission-option-is-enabled" aria-label="Permalink to &quot;Scenario 1: The &#39;**Artist Commission**&#39; option is enabled&quot;">​</a></h2><p>In this case, the Artist will get the amount of the design as mentioned by him while creating the product design whereas the Admin will get the difference between the product design &amp; product price.</p><p><em>Let&#39;s take an example:</em></p><p>Artist created a <em>product design</em> of $100.</p><p>Further, the Admin/Artist created a <em>product</em> &amp; added the above-created <em>product design</em> to it. Marked the product price at $120 (which should be greater than or equal to the product design price).</p><p>So, $100 will go to the Artist whereas, $20 will go to the Admin on every order purchase.</p><p><strong>NOTE</strong>: This feature will not work in case of the sales price!</p><h2 id="scenario-2-the-artist-commission-option-is-disabled" tabindex="-1">Scenario 2: The &#39;<strong>Artist Commission</strong>&#39; option is disabled <a class="header-anchor" href="#scenario-2-the-artist-commission-option-is-disabled" aria-label="Permalink to &quot;Scenario 2: The &#39;**Artist Commission**&#39; option is disabled&quot;">​</a></h2><p>The commissions will charge on the basis of the commission set on your marketplace. It can be any global, collection, product, membership or seller commission.</p><p>Furthermore, to know more about marketplace commissions:</p><ul><li><a href="https://webkul.com/blog/shopify-multivendor-marketplace-commissions-new-theme/" target="_blank" rel="noreferrer">Multivendor Marketplace for Shopify: Commissions</a></li><li><a href="https://webkul.com/blog/shopify-multivendor-marketplace-commission-type-new-theme/" target="_blank" rel="noreferrer">Multivendor Marketplace app for Shopify- Commission Type</a></li></ul><h3 id="mail-configuration" tabindex="-1">Mail Configuration <a class="header-anchor" href="#mail-configuration" aria-label="Permalink to &quot;Mail Configuration&quot;">​</a></h3><p>The admin can configure three types of mail regarding this app.</p><p>For this, visit <strong>multivendor marketplace admin panel</strong> &gt; <strong>Mail Configuration</strong>.</p><p>Here, admin can configure the following emails:</p><h4 id="change-initial-replacement-value" tabindex="-1">Change Initial Replacement Value <a class="header-anchor" href="#change-initial-replacement-value" aria-label="Permalink to &quot;Change Initial Replacement Value&quot;">​</a></h4><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/Mail-Configuration-Admin.png" alt="MAIL CONFIGURATION"></p><h4 id="final-initial-replacement-value" tabindex="-1">Final Initial Replacement Value <a class="header-anchor" href="#final-initial-replacement-value" aria-label="Permalink to &quot;Final Initial Replacement Value&quot;">​</a></h4><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/Mail-Configuration-Admin-1.png" alt="FINAL INITIAL REPLACEMENT VALUE"></p><h4 id="send-design-for-verification" tabindex="-1">Send Design for Verification <a class="header-anchor" href="#send-design-for-verification" aria-label="Permalink to &quot;Send Design for Verification&quot;">​</a></h4><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/Mail-Configuration-Admin-2.png" alt="SEND DESIGN FOR VERIFICATION"></p><p>Introducing <strong>Print On Demand</strong> feature in the Artist Product Design feature app of the Multi-vendor app. <a href="https://customcat.com/" target="_blank" rel="noreferrer">Custom Cat</a> is integrated with the app.</p><p>With this feature, you can allow sellers to add Print On Demand products from the seller panel that is fulfilled through <strong>Custom Cat</strong>.</p><p>This feature enables you to add the Print On Demand category and let sellers choose and admin catalog products to add Print On Demand products.</p><p>To configure this, visit the admin panel configuration&gt;&gt; Artist Product Design Configuration and select the Artist Configuration as &quot;<strong>print_on_demand</strong>&quot;</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/08/Artist-Product-Design-Configuration-Admin-1200x705.png" alt="Artist-Product-Design-Configuration-Admin"></p><p>Now, enable the Print On Demand tab and enter the custom cat details.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/08/Artist-Product-Design-Configuration-Admin-1-1138x1024.png" alt="Artist-Product-Design-Configuration-Admin-1"></p><p>Moreover, you need to select the country and shipping method to fulfill the Print On Demand products.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/08/Screenshot-2021-08-20T093921.311-1200x600.png" alt="Screenshot-2021-08-20T093921.311"></p><p>Now, proceed to add categories. Go to Producta and choose <strong>Print On Demand Category</strong> sub-menu.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/08/screenshot-shopify-trunk.webkul.com-2021.08.20-09_42_05-1200x590.png" alt="screenshot-shopify-trunk.webkul.com-2021.08.20-09_42_05"></p><p>Click <strong>Add Category</strong> button and add Print On Demand product category.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/08/POD-Category-Admin-1200x597.png" alt="POD-Category-Admin"></p><p>Choose the custom cat catalog from the drop-down menu and enter the price.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/08/Add-POD-Category-ADMIN-1200x607.png" alt="Add-POD-Category-ADMIN"></p><p>Categories are created this way. Let&#39;s move on to the seller panel.</p><p><strong>SELLER PANEL CONFIGURATION</strong></p><p>The seller will now have the option to add Print On Demand products. For this, the seller needs to visit the Products section &gt;&gt; Click Add Product &gt;&gt; Choose <strong>Admin Catalog Product</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/08/Product-Seller-%E2%80%A2-Multivendor-MarketPlace-1200x535.png" alt="Product-Seller-•-Multivendor-MarketPlace"></p><p>Enter the details related to the Print On Demand product.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/08/Catalog-Product-Seller-%E2%80%A2-Multivendor-MarketPlace-1130x1024.png" alt="Catalog-Product-Seller-•-Multivendor-MarketPlace"></p><p>That&#39;s all.</p><h3 id="demo-details" tabindex="-1">DEMO DETAILS <a class="header-anchor" href="#demo-details" aria-label="Permalink to &quot;DEMO DETAILS&quot;">​</a></h3><p>Furthermore, check out the demo for this app: <a href="https://artistic-marketplace.myshopify.com/pages/demo-details" target="_blank" rel="noreferrer">https://artistic-marketplace.myshopify.com/pages/demo-details</a></p>',187)])])}const g=e(a,[["render",r]]);export{u as __pageData,g as default};
